import React from 'react';
import style from './sideNav.css'
import fontAwesome from 'react-fontawesome';
import { Link } from 'react-router-dom';

const sideNavItems = () => {
    return (
        <div className={style.option}>
            <Link>
            </Link>
        </div>
    );
};

export default sideNavItems;
